import React from "react";
import "./Design.css";

// import { Container } from './styles';

function Design() {
  return (
    <div className="container">
      <div className="design_bar">
        <div className="design_content">
          <div className="design_info">
            <h2 className="design_title">Design Projects</h2>
            <p>
              Tenho experiência com o pacote Adobe (Photoshop, Illustrator,
              Adobe XD, After Effects e Premiere), conhecimento básico em Gimp e
              Figma, você pode ver todos meus projetos clicando no icone do
              Behance ali do lado em Social!
            </p>
          </div>

          <div className="design_icons">
            <div className="design_icons_title">
              <p>Social</p>
            </div>
            <div className="design_icons_group">
              <i class="fab fa-behance-square"></i>
              <i class="fab fa-adobe"></i>
            </div>
          </div>
        </div>
      </div>
      <div className="design_projects"></div>
    </div>
  );
}

export default Design;
